const https = require('https')

// https://api.etherscan.io/api?module=stats&action=chainsize&startdate=2021-02-01&enddate=2021-02-22&clienttype=geth&syncmode=default&sort=asc&apikey=YourApiKeyToken
const options = {
  hostname: 'api.etherscan.io',
  port: 443,
  path: '/api?module=stats&action=chainsize&startdate=2021-02-01&enddate=2021-02-22&clienttype=geth&syncmode=default&sort=asc&apikey=YourApiKeyToken',
  method: 'GET'
}

const getData = async () => new Promise((resolve, reject) => {
  const req = https.request(options, res => {
    let stats = ""

    console.log(`statusCode: ${res.statusCode}`)

    res.on('data', d => {
      stats += d
    })

    res.on('close', d => {
      console.log("close")
      resolve(stats)
    })
  })

  req.on('error', error => {
    reject(error)
  })

  req.end()
})

const main = async () => {
  const data = await getData()
  const json = JSON.parse(data)
  console.log("timestamp,blockNumber,chainSize")
  json.result.forEach((data) => {
    let csv = data.chainTimeStamp
    csv += ","+data.blockNumber
    csv += ","+data.chainSize

    console.log(csv)
  })
}

main().then()

